import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="text-center">
      <h1 className="text-4xl font-bold mb-8">Welcome to Uber Clone</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-2xl mx-auto">
        <Link
          to="/request-ride"
          className="p-6 bg-black text-white rounded-lg hover:bg-gray-800"
        >
          Request a Ride
        </Link>
        <Link
          to="/driver/dashboard"
          className="p-6 bg-gray-700 text-white rounded-lg hover:bg-gray-600"
        >
          Driver Dashboard
        </Link>
      </div>
    </div>
  );
};

export default Home;
